export const menu = [
    {
        id: 'home',
        title: 'Início',
        type: 'item',
        icon: 'home',
        url: 'home'
    },
    {
        id: 'provider',
        title: 'Fornecedores',
        type: 'item',
        icon: 'truck',
        url: 'fornecedores'
    },
    {
        id: 'apps',
        type: 'section',
        title: 'Parâmetros',
        icon: 'package',
        children: [
            {
                id: 'category',
                title: 'Categoria',
                type: 'item',
                icon: 'mail',
                url: 'apps/email'
            },
        ]
    }
];
